def get_model_size():
    """
    根据log中信息获取model_size
    :return:
    """
    dir_path = 'result/cifar10/cnn/hrank/noniid/log/weights_0.txt'
    file_path = os.path.join(root_path, dir_path)
    print(file_path)
    if not os.path.exists(file_path):
        print(1)
        return [dict(), dict()]
    with open(file_path,"r") as f:
        weights = f.read()
    filters_dic = dict()
    weights_dic = dict()
    points = re.findall("\[(.*?])]", weights)
    for point in points:
        filters = re.search("\[(.*)]", point)
        filters = filters.group(1).split(",")
        filters = [int(i) for i in filters]
        nums = re.findall("\d+", point)
        rounds = int(nums[0])
        size = int(nums[1])
        filters_dic[rounds] = filters
        weights_dic[rounds] = size
    print(weights_dic)
    print(filters_dic)

